node.text:
Какую бы стрижку вы не выбрали, придерживайтесь основных правил:

доверяйте свою стрижку мастеру-парикмахеру, если хотите получить желаемый результат;

каждая стрижка имеет несколько техник одной и той же стрижки, на более короткие волосы или более длинные;

покажите своему парикмахеру фото стрижки, которая вам нравится;

стрижка должна подходить вашей форме лица и структуре волос;

парикмахера следует посещать примерно раз в месяц, чтобы прическа не теряла форму и смотрелась аккуратно.
